import React, { useEffect } from 'react';
import Modal from 'react-modal';

const customStyles = {
  content: {
    /*    border: 'none',
    width: '95%',
    height: '100%',
    display: 'flex',
    justifyContent: 'center', */
  },
};

const CustomModal = ({ openModal = false, closeModal }) => {
  useEffect(() => {
    Modal.setAppElement('body');
  }, []);
  return (
    <Modal
      onRequestClose={closeModal}
      isOpen={openModal}
      style={customStyles}
      ariaHideApp={false}
    >
      <div className='user-detail-page__modal'>
        <h4>My Profile Settings</h4>
        <ul className='list'>
          {options.map(o => (
            <li>{}</li>
          ))}
        </ul>
      </div>
    </Modal>
  );
};

const options = ['security', 'account preferences', 'profile'];

export default CustomModal;
